import React from 'react';
import {View, Text, StyleSheet, TouchableOpacity} from 'react-native';

export default function Home() {
    return(
        <View>
            <Text>
                Luciano
            </Text>

            <View>
                <TouchableOpacity>
                    <Text>Co</Text>
                </TouchableOpacity>
            </View>
        </View>
    )
};

const styles = StyleSheet.create({
    content: {

    },

})
